import React from 'react';

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Food fav='kimchi' someting={true} papapapa={['hello',1,2,3,4,true]}/>
    </div>
  )
}

function Food(props) {
  return (
    <h1>I like potato</h1>
  )
}

export default App;
